import React from "react";
import { useNavigate } from "react-router-dom";
import Topbar from "../components/topbar";
import Navbar from "../components/header";
import Facts from "../components/product";
import Footer from "../components/fotter";  // Corrected the typo from 'fotter' to 'footer'
import Contact from "../components/contact";
import SingleSlide from "../components/slider";

const Home = () => {
  const navigate = useNavigate();

  const navigateToSecondPage = () => {
    navigate("/second");
  };

  return (
    <>
      <Topbar />
      <Navbar />
      <SingleSlide />
      <Facts />
      <Contact />
      <Footer />
      <button onClick={navigateToSecondPage}>Go to Second Page</button>
    </>
  );
};

export default Home;
